(1, 'About Us', '        <h1 xss=\"removed\" align=\"JUSTIFY\"><span xss=\"removed\"><span xss=\"removed\"><span xss=\"removed\"><span xss=\"removed\"><span xss=\"removed\">VISION AND VALUES</span></span></span></span></span></h1><p xss=\"removed\"><strong xss=\"removed\"><img loading=\"lazy\" src=\"https://www.mahindra-tsubaki.com/wp-content/uploads/2012/12/red_bullet.gif\" alt=\"\" width=\"8\" height=\"9\">  </strong>MTC offers Material Handling Solutions using future oriented technologies.</p><p xss=\"removed\"><strong xss=\"removed\"><img loading=\"lazy\" src=\"https://www.mahindra-tsubaki.com/wp-content/uploads/2012/12/red_bullet.gif\" alt=\"\" width=\"8\" height=\"9\">  </strong>Rich Application Experience derived from an array of successful installations.</p><p xss=\"removed\"><strong xss=\"removed\"><img loading=\"lazy\" src=\"https://www.mahindra-tsubaki.com/wp-content/uploads/2012/12/red_bullet.gif\" alt=\"\" width=\"8\" height=\"9\">  </strong>Full-fledged design set-up equipped with the latest drawing and modeling software.</p><p xss=\"removed\"><strong xss=\"removed\"><img loading=\"lazy\" src=\"https://www.mahindra-tsubaki.com/wp-content/uploads/2012/12/red_bullet.gif\" alt=\"\" width=\"8\" height=\"9\">  </strong>Well-established Manufacturing Facility supported by a large family of dedicated Sub-Vendors.</p><p xss=\"removed\"><strong xss=\"removed\"><img loading=\"lazy\" src=\"https://www.mahindra-tsubaki.com/wp-content/uploads/2012/12/red_bullet.gif\" alt=\"\" width=\"8\" height=\"9\">  </strong>Prompt After-sales Service.</p><p xss=\"removed\"><strong xss=\"removed\"><img loading=\"lazy\" src=\"https://www.mahindra-tsubaki.com/wp-content/uploads/2012/12/red_bullet.gif\" alt=\"\" width=\"8\" height=\"9\">  </strong>MTC is trusted by a number of customers in India and Abroad for Product Quality, Reliability and Service.</p><h1 xss=\"removed\" align=\"JUSTIFY\"><span xss=\"removed\"><span xss=\"removed\"><span xss=\"removed\"><span xss=\"removed\"><span xss=\"removed\">VISION :</span></span></span></span></span></h1><p xss=\"removed\">To identify Mahindra Tsubaki brand with Material Handling Solutions</p><p xss=\"removed\"><strong xss=\"removed\"><img loading=\"lazy\" src=\"https://www.mahindra-tsubaki.com/wp-content/uploads/2012/12/red_bullet.gif\" alt=\"\" width=\"8\" height=\"9\">  </strong>Achieve multiple growth in turnover and profits</p><p xss=\"removed\"><strong xss=\"removed\"><img loading=\"lazy\" src=\"https://www.mahindra-tsubaki.com/wp-content/uploads/2012/12/red_bullet.gif\" alt=\"\" width=\"8\" height=\"9\">  </strong>Associate with the most challenging assignments in material handling</p><p xss=\"removed\"><strong xss=\"removed\"><img loading=\"lazy\" src=\"https://www.mahindra-tsubaki.com/wp-content/uploads/2012/12/red_bullet.gif\" alt=\"\" width=\"8\" height=\"9\">  </strong>Become a preferred supplier for material handling solutions</p><p xss=\"removed\"><strong xss=\"removed\"><img loading=\"lazy\" src=\"https://www.mahindra-tsubaki.com/wp-content/uploads/2012/12/red_bullet.gif\" alt=\"\" width=\"8\" height=\"9\">  </strong>Innovate, excel and deliver value to all stakeholders</p><h1 xss=\"removed\" align=\"JUSTIFY\"><span xss=\"removed\"><span xss=\"removed\"><span xss=\"removed\"><span xss=\"removed\"><span xss=\"removed\">OUR PURPOSE AND VALUES</span></span></span></span></span></h1><p xss=\"removed\">Our motivation to give our very best, every day, comes from our core purpose: we will challenge conventional thinking and innovatively use ​all our resources to drive positive changes in the lives of our stakeholders and communities across the world—to enable them to Rise.<br>We have a commitment to sustainability—social, economic and environmental, that rests upon a set of core values. They are an amalgamation of what we have been, what we are and what we want to be. These values are the compass that guides our actions, both personal and corporate.</p><p xss=\"removed\">They are:​</p><p xss=\"removed\"><strong xss=\"removed\">Good corporate citizenship</strong><br>We will continue to seek long term success in alignment with the needs of the communities we serve. We will do so without compromising on<strong xss=\"removed\"> ethical business standards</strong>.</p><p xss=\"removed\"><strong xss=\"removed\">Professionalism</strong><br>We have always sought the best people for the job and believe in giving them the freedom and the opportunity to grow. We will continue to do so. We will support innovation and well-reasoned risk taking, with the only demand being:<strong xss=\"removed\"> ​performance</strong>.</p><p xss=\"removed\"><strong xss=\"removed\">Customer first</strong><br>We exist and prosper only because of the customer. We ordain to respond to the changing needs and expectations of our customers<strong xss=\"removed\"> speedily, courteously and effectively</strong>.</p><p xss=\"removed\"><strong xss=\"removed\">Quality focus</strong><br>Quality is the key to delivering value for money to our customers. We will make quality a driving value in our work, in our products and in our interactions with others. We will do it with one simple, yet all-encompassing approach: “<strong xss=\"removed\">First Time Right</strong>.”</p><p xss=\"removed\"><strong xss=\"removed\" xss=removed>Dignity of the individual​</strong></p><p xss=\"removed\">We will value individual dignity, uphold the right to express, even if it is a disagreement and respect the time and efforts of others. Through our actions, we will <strong xss=\"removed\">nurture fairness, trust and transparency.​</strong></p>', 'about', 'documents/images/1618216480-74184.jpg', NULL, NULL, 1, 1, 1, '2021-02-16 13:18:43'),
(2, 'Bulk Material Handling (BMH)', NULL, 'faq', NULL, 1, NULL, 1, 1, 1, '2021-02-16 16:24:12'),
(3, 'Chain Bucket elevator', '[{\"title\":\"What is the approximate or assured life of chain?\",\"order\":1,\"desc\":\" It depends upon the application, material to be conveyed etc. Please refer PO specifications or data sheets.\"},{\"title\":\"What is the permissible limit for chain elongation?\",\"order\":2,\"desc\":\"2% of nominal chain pitch.\\r\\n\"},{\"title\":\"How to measure chain elongation?\",\"order\":3,\"desc\":\" Please follow the procedure as specified in manual, for taking the readings and conclusion. Need to call our service engineer.\\r\\n\"},{\"title\":\"When chain procurement order to be placed ?\",\"order\":4,\"desc\":\"Tentatively when elongation reaches   up to 1 to 1.5 % \\r\\n\"},{\"title\":\"What kind of lubrication at tail shaft bearing?\",\"order\":5,\"desc\":\"As these are Ni- hard\\/HI-Chrome bearings \\u2013 No lubrication is required.\\r\\n\"},{\"title\":\" Whether chain is to be lubricated?\",\"order\":6,\"desc\":\"Lubrication is not required for chain.\\r\\n\"},{\"title\":\"Drive platform detail drawings? \",\"order\":7,\"desc\":\"In both cases i.e., Platform is supplied by MTC or Not supplied by MTC, detail drawings will be provided by MTC during execution stage.\\r\\n\"},{\"title\":\"Can we change the location of the boot level indicator?\",\"order\":8,\"desc\":\"Location of boot level indicator shall be as specified in the drawing only.\\r\\n\"},{\"title\":\"Can we change the position of Work access casing suitable to our floor location?\",\"order\":9,\"desc\":\"Yes, you can change however with approval from our Engineering.\\r\\n\\r\\n\"},{\"title\":\"Can we change the height of the elevator to suit the site conditions?\",\"order\":10,\"desc\":\"Please refer to our engineering for the required changes.\\r\\n\"},{\"title\":\"Can we assemble the buckets nuts outside the buckets?\",\"order\":11,\"desc\":\"No, it is not possible and also not advisable\\r\\n\\r\\n\"},{\"title\":\"Can we procure some items like buckets, hardware from local market?\",\"order\":12,\"desc\":\"No. MTC do not recommend \\r\\n\"},{\"title\":\"Can we cut opening in the casings for our suitability?\",\"order\":13,\"desc\":\" It is not advisable as it may affect the casing strength. In case it is essential need to take approval from MTC.  \"}]', 'faq', NULL, 0, 2, 1, 1, 1, '2021-02-16 17:26:18'),
(4, 'All equipments', '[{\"title\":\"How to adjust the take up at tail unit?\",\"order\":1,\"desc\":\"Need to refer manual and instruction plate provided for this on tail casing \"},{\"title\":\"What are the lubrication specifications and quantities for the drive components?\",\"order\":2,\"desc\":\"Please refer lubrication schedule provided in Installation, Operation & Maintenance manual.\\r\\n\"},{\"title\":\"What is Shock relay?  We have smart system with us, alternative to this will work. \",\"order\":3,\"desc\":\"As shock relay safety device for the elevator, it is mandatory as per GA Drawing.\\r\\n\"},{\"title\":\"What is the time setting for Tripping in shock relay? \",\"order\":4,\"desc\":\"As per the vendor standards it is normally 4 to 6 Sec \\r\\n\"},{\"title\":\"Can we change oil specifications as we do not have that particular grade oil\\/ lubrication?\",\"order\":5,\"desc\":\"Lubrication shall be as per the recommendations of the OEM only.\"},{\"title\":\"Can you depute your service person for the routine inspection the supplied equipment?\",\"order\":6,\"desc\":\"Yes. MTC will depute as per the P.O. Terms and conditions.\\r\\n\\r\\n\"},{\"title\":\"Any specific tool is required for Chain assembly \\/ Installation of equipment?\",\"order\":7,\"desc\":\"Normal tools and tackles required as mentioned in Installation, O & M manual.\\r\\n\"},{\"title\":\"When lubricating oil, grease to be replaced?\",\"order\":8,\"desc\":\"Please refer lubrication schedule provided in manual.\\r\\n\\r\\n\"}]', 'faq', NULL, 0, 2, 1, 1, 1, '2021-02-18 17:59:34'),
(5, 'FAQ - 11', 'FAQs', 'faq_page', 'documents/images/1680775151-84234.jpg', NULL, NULL, 1, 1, 1, '2021-02-25 10:46:48'),
(6, 'Unit Material Handling (UMH)', NULL, 'faq', NULL, 1, NULL, 1, 1, 1, '2021-02-25 10:47:59'),
(7, 'TH & TR Conveyor', '[{\"title\":\"What is the approximate or assured life of chain?\",\"order\":1,\"desc\":\"It depends upon the application, material to be conveyed etc. Please refer PO specifications or data sheets. \"},{\"title\":\" What is the permissible limit for chain elongation?\",\"order\":2,\"desc\":\"2% of nominal chain pitch.\"},{\"title\":\" How to measure chain elongation?\",\"order\":3,\"desc\":\"Please follow the procedure as specified in manual, for taking the readings and conclusion. Need to call our service engineer.\\r\\n\"},{\"title\":\" When chain procurement order to be placed?\",\"order\":4,\"desc\":\"Tentatively when elongation reaches   up to 1 to 1.5 % \"},{\"title\":\" When Back stopper need to adjust in Take-up unit?\",\"order\":5,\"desc\":\"Please adjust again when the space of the back-stopper becomes 50mm. Please set a gap of back-stopper to 20mm. (Refer O & M manual).\"},{\"title\":\"Can we change the Length of the Conveyor to suit the site conditions?\",\"order\":6,\"desc\":\"Please refer to our engineering for the required changes.\"},{\"title\":\"Can we procure some items like Chain, Sprocket, Tracks & hardware from local market?\",\"order\":7,\"desc\":\"No. MTC do not recommend.\"},{\"title\":\"How fast or slow can the overhead conveyor run?\",\"order\":8,\"desc\":\"Depending on the type of conveyor, the maximum speed can go up to 15 m\\/min. & minimum speed 5 m\\/min.\"},{\"title\":\"What is the maximum load capacity?\",\"order\":9,\"desc\":\"Please refer the Product catalogue.\"},{\"title\":\" How long can my conveyor system be?\",\"order\":10,\"desc\":\"The maximum system length is determined by chain pull. If the chain pull is less than mentioned value, the drive will pull the chain regardless of length. For extremely long systems, where the chain pull exceeds the drive rating, multiple drives can be used.\"},{\"title\":\" What is the maximum operating temperature for Conveyor?\",\"order\":11,\"desc\":\"Conveyor enclosed track conveyors are rated for a maximum temperature of 230 C, making them suitable for most applications.\\r\\n\"},{\"title\":\" How often does the conveyor need to be supported?\",\"order\":12,\"desc\":\"Hanger spacing for conveyor dependent on loading.\\r\\n\"},{\"title\":\" Can the system be grounded for Powder Coating Applications?\",\"order\":13,\"desc\":\"Yes. The system is fully conductive and can be grounded for this type of use.\\r\\n\"},{\"title\":\"How are sections of Conveyor track installed?\",\"order\":14,\"desc\":\"Track, curve, drive, take-up, etc. to connect track sections. For installations where welding is not suitable or permitted, optional bolt together construction is available.\"},{\"title\":\"  Do you offer a Power & Free conveyor?\",\"order\":15,\"desc\":\"Yes, we provide Power & Free conveyor.\\r\\n\"},{\"title\":\"Can you design a custom carrier for various product?\",\"order\":16,\"desc\":\"Absolutely. Our design team has developed custom carriers for a wide variety of products.\\r\\n\"}]', 'faq', NULL, 0, 6, 1, 1, 1, '2021-02-25 10:49:47'),
(8, 'MTC bags order for supply of Chain Conveyors, Screw Conveyors and Bucket Elevators (45 Conveyors to RSPL for their new Soda Ash Plant in Gujarat).', '', 'news', '[{\"file\":\"1617094669-0-49141.jpg\",\"path\":\"documents\\/news\\/1617094669-0-49141.jpg\",\"order\":0}]', NULL, NULL, 1, 1, 1, '2021-02-25 13:37:33'),
