(13, 'Contact Us', '  <h1 xss=\"removed\">CONTACT US</h1><p xss=\"removed\"><strong xss=\"removed\">Mahindra Tsubaki Conveyor Systems Private Limited</strong></p><p xss=\"removed\">Address : Gat No. 316-319, Ambadvet, Pune-Paud Road,<br>Near Pirangut,<br>Pune : 412 108<br>Maharashtra, India</p><p xss=\"removed\">Tel. : + 91 20 67928400 / 67928454<br>Fax : + 91 20 67928401</p><p xss=\"removed\">E-mail ID : <a href=\"mailto:mconveyor@mahindra.com\" xss=\"removed\">mconveyor@mahindra.com</a></p> ', 'contact', 'documents/images/1618216583-36180.jpg', NULL, NULL, 1, 1, 1, '2021-03-04 18:59:37'),
(14, 'All equipment\'s', '[{\"title\":\"How to adjust the take up at tail unit?\",\"order\":1,\"desc\":\"Need to refer manual and instruction plate provided for this on Tail Unit. \"},{\"title\":\"What are the lubrication specifications and quantities for the drive components?\",\"order\":2,\"desc\":\"Please refer lubrication schedule provided in Installation, Operation & Maintenance manual.\\r\\n\"},{\"title\":\"Can we change oil specifications as we do not have that particular grade oil\\/ lubrication?\",\"order\":3,\"desc\":\" Lubrication shall be as per the recommendations of the OEM only.\\r\\n\"},{\"title\":\"Can you depute your service person for the routine inspection the supplied equipment?\",\"order\":4,\"desc\":\"Yes. MTC will depute as per the P.O. Terms and conditions.\\r\\n\"},{\"title\":\"Any specific tool is required for Chain assembly \\/ Installation of equipment?\",\"order\":5,\"desc\":\"ormal tools and tackles required as mentioned in Installation, O & M manual.\"},{\"title\":\"When lubricating oil, grease to be replaced?\",\"order\":6,\"desc\":\" Please refer lubrication schedule provided in manual.\\r\\n\"},{\"title\":\"How much does a conveyor cost?\",\"order\":7,\"desc\":\"Each conveyor system is priced out as per the design. Please    contact mconveyor@mahindra.com to speak with a MTC Engineer who can help with an estimate.\"},{\"title\":\"What is the lead time on delivery of a conveyor systems?\",\"order\":8,\"desc\":\" The lead time is dependent on the scope of the project. Simple projects can be as short as 8 weeks. More complex projects can be 10 to 14 weeks.\\r\\n\"},{\"title\":\"What Information do I need to provide for quotation?\",\"order\":9,\"desc\":\"Ideally, the following minimum information is needed for a quotation:\\r\\n1) Dimensioned layout of the system\\r\\n2) Description of what you want the system to do\\r\\n3) Description of what the conveyor is carrying, including size and weight.\\r\\n4) How would you like the system to be supported, via floor stands or ceiling?\\r\\n5) If ceiling, we would require the truss height, spacing and orientation. Any photos during this process are a huge help.\\r\\n\"},{\"title\":\"Can you provide installation?\",\"order\":10,\"desc\":\"Yes, we provide installation only for supplied conveyor by MTC. \\r\\n\"},{\"title\":\"How to identify Field Cables?\",\"order\":11,\"desc\":\"Every Cable comes with Tag attached at Source end and destination end of cable wherein FROM and TO locations and cable no. is mentioned on it.\\r\\n\"},{\"title\":\"How to identify which emergency stop is pressed and where it is located?\",\"order\":12,\"desc\":\"On HMI we give conveyor layout screen.\\r\\n1) To refer which emergency stop is pressed, go to Alarm\\/error screen.\\r\\n2) To check the emergency, stop PB location, go to conveyor layout screen where all Emergency Stop marked as per location with ON\\/OFF Indication.\\r\\n\"},{\"title\":\"How to check conveyor pre-requisite to start?\",\"order\":13,\"desc\":\"On HMI there will be a screen given for AUTO-start condition.\\r\\n\"},{\"title\":\"How to check Input\\/output status?\",\"order\":14,\"desc\":\" Go to Input\\/output status screen on HMI you will see all I\\/O status.\\r\\n\"},{\"title\":\"How to set Lubrication cycle for my conveyor?\",\"order\":15,\"desc\":\"Go to Lubrication setting screen, enter Pin number, you will see Lubrication setting screen. Add lubrication data to start lubrication cycle for your conveyor.\\r\\n\"}]', 'faq', NULL, 0, 6, 1, 1, 1, '2021-03-19 15:52:22'),
(15, 'Supplied tyre handling conveyor systems to Bridgestone', 'Supplied tyre handling conveyor systems to Bridgestone', 'news', '[{\"file\":\"1618217228-0-16504.jpg\",\"path\":\"documents\\/news\\/1618217228-0-16504.jpg\",\"order\":0}]', NULL, NULL, 1, 1, NULL, '2021-04-12 14:17:08'),
(16, 'Slat Conveyor', '[{\"title\":\"What is the approximate or assured life of chain?\",\"order\":1,\"desc\":\"It depends upon the application, material to be conveyed etc. Please refer PO   specifications or data sheets.\"},{\"title\":\"What is the permissible limit for chain elongation?\",\"order\":2,\"desc\":\" 2% of nominal chain pitch.\\r\\n\"},{\"title\":\"How to measure chain elongation?\",\"order\":3,\"desc\":\"Please follow the procedure as specified in manual, for taking the readings and conclusion. Need to call our service engineer.\\r\\n\"},{\"title\":\"When chain procurement order to be placed \",\"order\":4,\"desc\":\"Tentatively when elongation reaches   up to 1 to 1.5 % \\r\\n\"},{\"title\":\"Whether chain is to be lubricated?\",\"order\":5,\"desc\":\"Yes, chain is lubricated.\\r\\nFor lubrication refer O & M manual.\\r\\n\"},{\"title\":\"Can we change the Length of the Conveyor to suit the site conditions?\",\"order\":6,\"desc\":\"Please refer to our engineering for the required changes.\"},{\"title\":\"Can we procure some items like Chain, Sprocket, Tracks & hardware from local market?\",\"order\":7,\"desc\":\"No. MTC do not recommend.\\r\\n\"},{\"title\":\"How fast or slow can the conveyor run?\",\"order\":8,\"desc\":\"Depending on the type of conveyor, the maximum speed can go up to 30 m\\/min. & minimum speed 0.2 m\\/min.\\r\\n\\r\\n\"},{\"title\":\"What is the maximum load capacity?\",\"order\":9,\"desc\":\"Please refer the Product catalogue.\\r\\n\"},{\"title\":\"How long can my conveyor system be?\",\"order\":10,\"desc\":\"The maximum system length is determined by chain pull. If the chain pull is less than mentioned value, the drive will pull the chain regardless of length. For extremely long systems, where the chain pull exceeds the drive rating.\\r\\n\"},{\"title\":\"What is the maximum operating temperature for Conveyor?\",\"order\":11,\"desc\":\" Conveyor enclosed track conveyors are rated for a maximum temperature of 80 C, making them suitable for most applications.\\r\\n\"},{\"title\":\"   Can the system be grounded for Assembly & Inspection Applications?\",\"order\":12,\"desc\":\"Yes. The system is fully conductive and can be grounded for this type of use.\"},{\"title\":\"How are sections of Conveyor track installed?\",\"order\":13,\"desc\":\"Track, drive, take-up, etc. to connect track sections. For installations where welding is not suitable or permitted, optional bolt together construction is available.\"},{\"title\":\"Can you design a custom carrier for various product?\",\"order\":14,\"desc\":\"Absolutely. Our design team has developed custom carriers for a wide variety of products.\\r\\n\"}]', 'faq', NULL, 0, 6, 1, 1, NULL, '2021-05-26 19:56:43'),
(17, 'Chain Feeder, Rotary Feeder, Traverser & Working Conveyor', '[{\"title\":\"What is the approximate or assured life of chain?\",\"order\":1,\"desc\":\" It depends upon the application, material to be conveyed etc. Please refer PO   specifications or data sheets. \\r\\n\\r\\n\"},{\"title\":\" What is the permissible limit for chain elongation?\",\"order\":2,\"desc\":\"2% of nominal chain pitch.\"},{\"title\":\" How to measure chain elongation?\",\"order\":3,\"desc\":\" Please follow the procedure as specified in manual, for taking the readings and conclusion. Need to call our service engineer.\\r\\n\"},{\"title\":\"When chain procurement order to be placed  \",\"order\":4,\"desc\":\" Tentatively when elongation reaches   up to 1 to 1.5 % \\r\\n\"},{\"title\":\"Whether chain is to be lubricated?\",\"order\":5,\"desc\":\"Yes, chain is lubricated.\\r\\nFor lubrication refer O & M manual.\\r\\n\"},{\"title\":\"Can we change the Length of the Conveyor to suit the site conditions?\",\"order\":6,\"desc\":\" Please refer to our engineering for the required changes.\\r\\n\"},{\"title\":\"Can we procure some items like Chain, Sprocket, Tracks & hardware from local market?\",\"order\":7,\"desc\":\" No. MTC do not recommend.\\r\\n\"},{\"title\":\"How fast or slow can the conveyor run?\",\"order\":8,\"desc\":\"Depending on the type of conveyor, the maximum speed can go up to 40 m\\/min. & minimum speed 2 m\\/min.\\r\\n\"},{\"title\":\"What is the maximum load capacity?\",\"order\":9,\"desc\":\"Please refer the Product catalogue.\\r\\n\\r\\n\"},{\"title\":\"How long can my conveyor system be?\",\"order\":10,\"desc\":\"The maximum system length is determined by chain pull. If the chain pull is less than mentioned value, the drive will pull the chain regardless of length. For extremely long systems, where the chain pull exceeds the drive rating.\"},{\"title\":\"What is the maximum operating temperature for Conveyor?\",\"order\":11,\"desc\":\" Conveyor enclosed track conveyors are rated for a maximum temperature of 80 C, making them suitable for most applications.\\r\\n\"},{\"title\":\"   Can the system be grounded for Paint, Assembly & Inspection Applications?\",\"order\":12,\"desc\":\"Yes. The system is fully conductive and can be grounded for this type of use.\"},{\"title\":\"How are sections of Conveyor track installed?\",\"order\":13,\"desc\":\"Track, drive, take-up, etc. to connect track sections. For installations where welding is not suitable or permitted, optional bolt together construction is available.\\r\\n\\r\\n\"},{\"title\":\"Can you design a custom carrier for various product?\",\"order\":14,\"desc\":\"Absolutely. Our design team has developed custom carriers for a wide variety of products.  \\r\\n\"}]', 'faq', NULL, 0, 6, 1, 1, NULL, '2021-05-26 20:02:03'),
(18, 'Chain Conveyor', '[{\"title\":\"What is the approximate or assured life of chain?\",\"order\":1,\"desc\":\" It depends upon the application, material to be conveyed etc. Please refer PO specifications or data sheets. \\r\\n\"},{\"title\":\"Can we change the length of the conveyor to suit the site conditions?\",\"order\":2,\"desc\":\"Please refer to our engineering for the required changes.\"},{\"title\":\"Can we cut opening in the casings for our suitability?\",\"order\":3,\"desc\":\" It is not advisable as it may affect the casing strength. In case it is essential need to take approval from MTC.  \"}]', 'faq', NULL, 0, 2, 1, 1, NULL, '2021-05-26 20:30:26'),
(19, 'Mahindra Bulk Feeder', '[{\"title\":\"What is the approximate or assured life of chain?\",\"order\":1,\"desc\":\" It depends upon the application, material to be conveyed etc. Please refer PO specifications or data sheets. \\r\\n\"},{\"title\":\"Whether chain is to be lubricated?\",\"order\":2,\"desc\":\"No lubrication is not required for chain (In case of Tsubaki Chain) \\r\\n\"},{\"title\":\"Can we change the size of the Grizzley square ?\",\"order\":3,\"desc\":\"Please refer our Engineering team for any type of such changes. \\r\\n\"},{\"title\":\"Can we feed the bulk feeder when feeder is in Off condition?\",\"order\":4,\"desc\":\"No, Material to be feed to the feeder when feeder is in running condition only. Inlet hopper &   feeder to  be  kept  always  empty , free  from any  accumulation of  the material. \\r\\n\"}]', 'faq', NULL, 0, 2, 1, 1, NULL, '2021-05-26 20:32:56'),
